import React from 'react'

const Navbar = () => {
  return (
    <div>
      <div>
        <a href="/" className="text-2xl font-bold text-gray-800">
          <span className="text-blue-500">My</span>Website
        </a>
      </div>
    </div>
  )
}

export default Navbar
